import React from 'react';
import PropTypes from 'prop-types';
import './TableView.css'; // Ensure this CSS file exists and is correctly linked.

const TableView = ({ data }) => {

    // Check if data exists and has the expected structure
    if (!data || !data.StepwiseFilteredData || !Array.isArray(data.StepwiseFilteredData) || data.StepwiseFilteredData.length === 0) {
        return <div>No data available</div>;
    }

    // Function to apply conditional formatting based on value comparison
    const getCellClass = (percentage, overallPercentage) => {
        if (percentage < overallPercentage) {
            return 'green';
        } else if (percentage > overallPercentage) {
            return 'red';
        }
        return ''; // No special class if percentages are equal
    };

    // Mapping region codes to names (Example mapping, update as needed)
    const regionMapping = {
        CZ10: 'Praha',
        CZ20: 'Středočeský kraj',
        CZ31: 'Jihočeský kraj',
        CZ32: 'Plzeňský kraj',
        CZ41: 'Karlovarský kraj',
        CZ42: 'Liberecký kraj',
        CZ51: 'Královéhradecký kraj',
        CZ52: 'Pardubický kraj',
        CZ53: 'Kraj Vysočina',
        CZ63: 'Jihomoravský kraj',
        CZ64: 'Olomoucký kraj',
        CZ71: 'Zlínský kraj',
        CZ72: 'Moravskoslezský kraj',
        CZ80: 'Other' // Just as an example
    };

    return (
        <div className="table-container">
            <h2>VÝSLEDEK VYHLEDÁVÁNÍ</h2>

            <div className="filter-combination">
                <span>Kombinace filtrů:</span>
                <a href="#125">#125</a>
                <a href="#152">#152</a>
                <a href="#215">#215</a>
                <a href="#231">#231</a>
                <a href="#312">#312</a>
                <a href="#321">#321</a>
            </div>

            <table className="data-table">
                <thead>
                    <tr>
                        <th>Region</th>
                        <th colSpan="2">Nedostatek zeleniny a ovoce</th>
                        <th colSpan="2">Hypertenze</th>
                        <th colSpan="2">Fyzická aktivita</th>
                    </tr>
                    <tr>
                        <th>Kraj</th>
                        <th>Krajský průměr</th>
                        <th>Celostátní průměr</th>
                        <th>Krajský průměr</th>
                        <th>Celostátní průměr</th>
                        <th>Krajský průměr</th>
                        <th>Celostátní průměr</th>
                    </tr>
                </thead>
                <tbody>
                    {data.StepwiseFilteredData[0].RegionSummary.map((regionData, index) => {
                        const overallVeggie = data.StepwiseFilteredData[0].OverallPercentage || 0;
                        const overallHypertense = data.StepwiseFilteredData[1]?.OverallPercentage || 0;
                        const overallPhysical = data.StepwiseFilteredData[2]?.OverallPercentage || 0;

                        const regionVeggie = regionData.Percentage || 0;
                        const regionHypertense = data.StepwiseFilteredData[1]?.RegionSummary[index]?.Percentage || 0;
                        const regionPhysical = data.StepwiseFilteredData[2]?.RegionSummary[index]?.Percentage || 0;

                        return (
                            <tr key={index}>
                                <td>{regionMapping[regionData.Region] || 'Unknown'}</td>
                                <td className={getCellClass(regionVeggie, overallVeggie)}>{regionVeggie.toFixed(2)}%</td>
                                <td>{overallVeggie.toFixed(2)}%</td>
                                <td className={getCellClass(regionHypertense, overallHypertense)}>{regionHypertense.toFixed(2)}%</td>
                                <td>{overallHypertense.toFixed(2)}%</td>
                                <td className={getCellClass(regionPhysical, overallPhysical)}>{regionPhysical.toFixed(2)}%</td>
                                <td>{overallPhysical.toFixed(2)}%</td>
                            </tr>
                        );
                    })}
                </tbody>
            </table>
        </div>
    );
};

// Adding prop types to enforce type checking
TableView.propTypes = {
    data: PropTypes.shape({
        StepwiseFilteredData: PropTypes.arrayOf(PropTypes.shape({
            RegionSummary: PropTypes.arrayOf(PropTypes.shape({
                Region: PropTypes.string,
                Percentage: PropTypes.number
            })),
            OverallPercentage: PropTypes.number
        }))
    })
};

export default TableView;
